import React from "react";
import ReactDOM from "react-dom";
import "./index.css"


let msg = "Hello Sir"
let currTime = new Date(2022,10,19,19)
currTime = currTime.getHours()
let greeting = ""
let greetingStyle = {}


if(currTime >= 1 && currTime < 12){
  greeting = "Good Morning"
  greetingStyle.color.padding = "green"
}else if(currTime > 12 && currTime <= 16){
  greeting = "Good Afternoon"
  greetingStyle.color = "orange"
}else if(currTime >= 17 && currTime < 20) {
  greeting = "Good Evening"
  greetingStyle.color = "red"
}else{
  greeting = "Goog Night"
  greetingStyle.color = "black"
}



ReactDOM.render(
  <> 
    <h1> {msg},
      <span style={greetingStyle}>{greeting}</span>
    </h1>
  </>,
  document.getElementById("root")
  )
